import ServicesList from './ServicesList'

const services_data = [
    {
        title: 'Laboratory Services',
        list: [
            'Iron content: $5',
            'Blood cell count: $10',
            'Chemistry panel: $15'
        ]
    },
    {
        title: 'Radiology Services',
        list: [
            'X-ray: $20',
            'MRI scan: $50',
            'Ultrasound: $30'
        ]
    },
    {
        title: 'Medical Consultations',
        list: [
            'General check-up: $25',
            'Specialized consultation: $40',
            'Mental health assessment: $35'
        ]
    }
];

function Services(props){
    return<section>
        <ServicesList services={services_data}/>
    </section>
}

export default Services;
